def count_valid_rectangles(n, m, c):
    r = math.floor(math.sqrt(c))
    p = 1
    for j in range(1, r + 1):
        if c % j != 0:
            continue
        d = c // j
        if j <= n and d <= m:
            p += 1
        if j != d and j <= m and (d <= n):
            p += 1
    return p

